import React from "react";
import { Link , Outlet} from 'react-router-dom';




const About = () =>{

  
   
    return(
         
    
      
    <>
      <div className="head">
      
       

       
        <Link  to= '/about/qualification'>Graduation</Link>
        <Link  to= '/about/habbits'> Habbits</Link>
        <Link  to= '/about/personal'>personalinfo</Link>

        
        </div>    
        <section>
          <div className="content">
            <div className="box">

            </div>
          </div>
        </section>  
        

 
        
        <Outlet />
        </>
     
      
               
        
    )
}
export default About ;
